<script>
    document.addEventListener("DOMContentLoaded", function () {
        const mapId = Object.keys(window).find(k =>
            window[k] &&
            typeof window[k].on === 'function' &&
            '_leaflet_id' in window[k]
        );
        const map = window[mapId];
        const legend = document.getElementById("austin-legend");

        map.on('overlayadd', function(e) {
            if (e.name === "Austin" && legend) {
                legend.style.display = "block";
            }
        });

        map.on('overlayremove', function(e) {
            if (e.name === "Austin" && legend) {
                legend.style.display = "none";
            }
        });
    });
</script>

<script>
    function togglePOILayers(map, show = false, targetLayerName = null) {
        map.eachLayer(function(layer) {
            const name = layer.options && layer.options.name;
            if (!name || !name.startsWith("POIs:")) return;

            if (targetLayerName) {
                if (name === targetLayerName && !map.hasLayer(layer)) {
                    map.addLayer(layer);
                }
            } else if (!show) {
                map.removeLayer(layer);
            }
        });
    }
</script>
    
<script>
    function jumpTo(lat, lon, zoom=12, layerName="Austin") {
        console.log("Attempting to jump to: ", layerName); // Debug: Confirm function call
        const mapId = Object.keys(window).find(k => window[k] && typeof window[k].setView === 'function');
        if (mapId) {
            const map = window[mapId];
            console.log("Map found, performing flyTo.");
            map.flyTo([lat, lon], zoom, { animate: true, duration: 1.5 });

            console.log("Evaluating layers:");
            let layerFound = false;
            map.eachLayer(function(layer) {
                console.log("Layer on Map: ", layer.options && layer.options.name); // Log each layer's name
                if (layer instanceof L.FeatureGroup && layer.options && layer.options.name === layerName) {
                    map.addLayer(layer);
                    console.log("FeatureGroup added: ", layerName); // Debug: Confirm layer addition
                    layerFound = true;
                }
            });
            if (!layerFound) {
                console.log("FeatureGroup not found: ", layerName); // Debug: Layer not found
            }
        } else {
            console.log("Map ID not found."); // Debug: Map ID not located
        }
    }
</script>
    
<script>
document.addEventListener("DOMContentLoaded", function() {
    // Function to rename layers
    function renameLayers() {
        var layerControlItems = document.querySelectorAll('.leaflet-control-layers-selector + span');
        layerControlItems.forEach(function(label) {
            if(label.textContent.includes("https://server.arcgisonline.com")) {
                label.textContent = 'Main Map'; // Rename base map
            }
        });

        // Renaming the overlay layers
        var overlays = document.querySelectorAll('.leaflet-control-layers-overlays label');
        overlays.forEach(function(overlay) {
            if (overlay.textContent.includes("Points")) {
                overlay.textContent = overlay.textContent.replace("Points", "Points of Interest");
            }
        });
    }

    // Attempt to rename layers after a slight delay to ensure layers are loaded
    setTimeout(renameLayers, 500);
});
</script>
